--
-- Create procedure `Proc_employee_GetDataFilterPaging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_employee_GetDataFilterPaging (IN v_Offset int -- là số thứ tự của bản ghi lúc bắt đầu lấy
, IN v_Limit int -- là số bản ghi muốn lấy
, IN v_Sort varchar(100)
, IN v_Where varchar(1000))
COMMENT '
  -- Author:        HMHieu
  -- Created date:  16/09/2022
  -- Description:   Lấy danh sách nhân viên và tổng số nhân viên có phân trang
  -- Modified by:
  -- Code chạy thử: CALL `misa.qtkd.ex.hieu`.Proc_employee_GetDataFilterPaging(0, 10, NULL, NULL);'
BEGIN

  -- Kiểm tra tham số đầu vào của v_where nếu bằng NULL --> gán v_where 1=1
  -- Select * from Employee where 1=1
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = 1 = 1;
  END IF;

  -- Kiếm tra tham số đầu vào của v_Sort nếu bằng NULL --> gán v_Sort = ''
  -- Select * from Employee Where 1=1 ORDER BY ModifiedDate DESC
  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedDate DESC';
  END IF;

  -- Nối chuỗi query
  SET @filterQuery = CONCAT('SELECT * FROM employee WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Limit, ' OFFSET ', v_Offset);

  -- filterquery là một biến có kiểu dữ liệu là String

  PREPARE filterQuery FROM @filterQuery; -- chuyển đổi từ String sang command
  EXECUTE filterQuery; -- Chạy command
  DEALLOCATE PREPARE filterQuery; -- Giải phóng vùng nhớ cho filter sau khi chạy 

  -- Lấy ra tổng số bản ghi thỏa mãn điều kiện lọc
  SET @totalItem = CONCAT('Select count(EmployeeID) as TotalCount From employee Where ', v_Where);
  PREPARE totalItem FROM @totalItem; -- chuyển đổi từ String sang command
  EXECUTE totalItem; -- Chạy command
  DEALLOCATE PREPARE totalItem; -- Giải phóng vùng nhớ cho filter sau khi chạy 









END
$$

